import React from 'react';
import { useState } from 'react';
import { Slider } from '@mui/material';

import './CreateLobby.css';

export function BotSettings() {
  const [messageLength, setMessageLength] = useState(50);
  const [messageFreq, setMessageFreq] = useState(50);

  return (
    <div style={{ 
      paddingRight: 30,
      backgroundColor: '#eeeeee',
      borderRadius: 20,
      justifyContent: 'center',
      alignItems: 'center',
      }}>
      <p
        style={{
          fontSize: 29,
          marginBottom: 5,
        }}
      >
        {'Facilitator Bot Settings'}
      </p>
      <div style={{ display: 'flex', alignItems: 'center', marginBottom: 0 }}>
        <p style={{ fontSize: 27, marginRight: 15 }}>{'Custom Name'}</p>

        <div
          className={'box-container'}
          style={{
            width: 311,
            height: 49,
          }}
        />
      </div>

      <div>
        <p
          style={{
            fontSize: 27,
            marginTop: 0,
            marginBottom: 15,
          }}
        >
          {'Message Length'}
        </p>
        <div
          className={'box-container'}
          style={{ width: 356, height: 52, padding: 20 }}
        >
          <Slider
            aria-label="Message Lengtth"
            defaultValue={30}
            valueLabelDisplay="auto"
            step={10}
            marks={false}
            min={10}
            max={110}
          />
        </div>
      </div>

      <div>
        <p
          style={{
            fontSize: 27,
            marginBottom: 15,
          }}
        >
          {'Message Frequency'}
        </p>
        <div
          className={'box-container'}
          style={{ width: 356, height: 52, padding: 20 }}
        >
          <Slider
            aria-label="Message Lengtth"
            defaultValue={30}
            valueLabelDisplay="auto"
            step={10}
            marks={false}
            min={10}
            max={110}
          />
        </div>
      </div>
      <div></div>
    </div>
  );
}
